MongoDB - aggregation using map within map<p>Is it possible map an array, within an array of objects?</p>
<p>I currently have this addFields pipeline stage and the code in question is the second array element for the $setUnion aggregator. It currently returns the arrays in which the values I need are in, so I end up with a 'users' array made up of arrays (from the second map stage), and then string values from the other items in the setUnion array code, but I just need all the string values from the nested array.</p>
<p>Document example output after addField currently:</p>
<pre><code>{   
    _id: '6291f69f811b414175d11b16',
    savesOnComment: [],
    comments: [{
            _id: '6297aa1112c9fe003a32ddeb',
            owner: '61152b692816b44ff246e07b',
            contentId: '6291f69f811b414175d11b16',
            replyId: null,
            saves: ['61152b692816b44ff246e07b']
        }, {
            _id: '6297aa1512c9fe003a32dded',
            owner: '61152b692816b44ff246e07b',
            contentId: '6291f69f811b414175d11b16',
            replyId: null,
            saves: ['61152b692816b44ff246e07b']
        }],
    users: [
        ['61152b692816b44ff246e07b'],
        '61152b692816b44ff246e07b',
        ]

}
</code></pre>
<p>addFields pipeline stage:</p>
<pre><code>{
      'users': {
        '$setUnion': [{
          '$map': {
            'input': '$comments',
            'as': 'each',
            'in': '$$each.owner'
          }
        }, {
          '$map': {
            'input': '$comments',
            'as': 'each',
            'in': {
              '$map': {
                'input': '$$each.saves',
                'as': 'save',
                'in': '$$save'
              }
            }
          }
        }, 
        '$savesOnComment']
      }
    }
</code></pre>

