Type is missing the following properties from type 'Schema<any, Model<any,any,any,any>, {}, {}>': add, childSchemas, clearIndexes, clone, and 37 more<p>I've got a Mongoose on TypeScript, and it worked without interfaces and types defining, but when I decided to define types, the madness started. I've watched tons of manuals and topics and found nobody with a similar problem. I tried to define a model strictly by the manual, but I'm getting an error. Here's my model file:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>import mongoose from 'mongoose';
import { nanoid } from 'nanoid';

const GeoSchema = new mongoose.Schema({
    type: {
        type: String,
        default: 'Point',
        enum: ['Point'],
    },
    coordinates: {
        type: [Number, Number],
        index: '2dsphere',
    },
});

interface postInterface extends mongoose.Document {
    shortId: string;
    createdBy: string;
    title: string;
    description: string;
    tags: string[];
    location: {};
    images: string[];
    contacts: {
        email: Boolean;
        wa: Boolean;
        phone: Boolean;
    };
    type: 'available' | 'wanted';
    is_moderated: Boolean;
}

export const PostSchema = new mongoose.Schema(
    {
        shortId: {
            type: String,
            index: true,
            default: () =&gt; nanoid(),
        },
        createdBy: {
            type: String,
            index: true,
        },
        title: String,
        description: String,
        tags: [String],
        location: GeoSchema,
        images: [String],
        contacts: {
            email: Boolean,
            wa: Boolean,
            phone: Boolean,
        },
        type: { type: String, enum: ['available', 'wanted'] },
        is_moderated: Boolean,
    },
    { timestamps: true }
);

export const Post = mongoose.model&lt;postInterface&gt;('Post', PostSchema);</code></pre>
</div>
</div>
</p>
<p>When I import it into another file, on the line</p>
<pre><code>return Post.create(post)
</code></pre>
<p>the linter gives me the error:</p>
<pre><code>Type 'postInterface &amp; { _id: any; }' is missing the following properties from type 'Schema&lt;any, Model&lt;any, any, any, any&gt;, {}, {}&gt;': add, childSchemas, clearIndexes, clone, and 37 more.ts(2740)
</code></pre>
<p>I googled examples of typescript model defining, and it looks like something that works for others doesn't work for me.</p>
<p>What am I doing wrong?</p>
<h2>Update</h2>
<p>Man, it was so obvious! The file where I imported the model looks like this:</p>
<pre><code>import { Post, PostSchema } from '../models/post.model';
export class PostService {
    async createPost(post: any): Promise&lt;typeof PostSchema | null&gt; {
        return Post.create(post);
    }

    async getPostById(shortId: string): Promise&lt;typeof PostSchema | null&gt; {
        return Post.findOne({ shortId });
    }
}
</code></pre>
<p>So the thing was in <code>Promise&lt;typeof PostSchema | null&gt;</code>. When I changed the code to this, the error was gone:</p>
<pre><code>import { Post, postInterface } from '../models/post.model';
export class PostService {
    async createPost(post: any): Promise&lt;postInterface | null&gt; {
        return Post.create(post);
    }

    async getPostById(shortId: string): Promise&lt;postInterface | null&gt; {
        return Post.findOne({ shortId });
    }
}
</code></pre>
<p>Thanks to @lpizzinidev for pushing me in the right direction!</p>

